import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import Card from "./Card";

import { connect } from "react-redux";
class Home extends React.Component {
  state = {
    cards: [{ id: 1, carrierCode: "XB" }, { id: 2, carrierCode: "HC" }]
  };
  handle = () => {
    const cards = this.state.cards;
    cards.push({ id: 3, carrierCode: "BA" });
    this.setState(cards);
  };
  render() {
    console.log(this.props.carrierCode);
    return (
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh"
        }}
      >
        {this.state.cards.map(card => (
          <Card key={card.id} carrierCode={card.carrierCode} selected={true} />
        ))}
        <Fab size="large" aria-label="Add" onClick={this.handle}>
          <AddIcon />
        </Fab>
      </div>
    );
  }
}
const mapStateToProps = state => {
  return state;
};
export default connect(mapStateToProps)(Home);
